$(document).ready(function(){$(".nav-link-collapse").on("click",function(){$(".nav-link-collapse").not(this).removeClass("nav-link-show");$(this).toggleClass("nav-link-show")})});$(document).ready(function(){$("#showGame").click(function(){var n=$("#gameModal").data("url");$.get(n,function(n){$("#gameContainer").html(n);$("#gameModal").modal("show")})})});